import React from "react";
import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";
import Table from "@material-ui/core/Table";
import { TableHead, TableRow, TableCell } from "@material-ui/core";
import AddCircleIcon from "@material-ui/icons/AddCircle";
import RemoveCircleOutlineIcon from "@material-ui/icons/RemoveCircleOutline";
const PizzaOrder = () => {
  return (
    <div>
      <Grid>
        <Typography align="left">ORDER Pizza</Typography>
        <div style={{ marginLeft: 350, width: "50px" }}>
          <Table>
            <TableHead></TableHead>
            <TableHead align="left">
              <TableRow align="left">
                  <TableCell><RemoveCircleOutlineIcon/></TableCell>
                <TableCell>Small</TableCell>{" "}
                <TableCell>
                  <AddCircleIcon />
                </TableCell>
              </TableRow>
              <TableRow align="left"> <TableCell>Medium</TableCell>{" "}
                <TableCell>
                  <AddCircleIcon />
                </TableCell></TableRow>
              <TableRow align="left"> <TableCell>Large</TableCell>{" "}
                <TableCell>
                  <AddCircleIcon />
                </TableCell></TableRow>
            </TableHead>
          </Table>
        </div>
      </Grid>
    </div>
  );
};

export default PizzaOrder;
